def fitnnes(item):
    dist = 0
    cityant = item[0]
    for cityact in item[1:N_CHROMOSOMES]:
        dist = dist + distance[cityant][cityact]
        cityant = cityact
    dist = dist + distance[cityant][item[0]]
    return dist

