        GA=GeneticAlgorithm(f, chro, itmax=ITMAX, selection_type=SELECTION_TYPE,
                            High_Low=HIGH_LOW, size_pool=SIZE_PULL, child_type=TYPECHILD, porcent_elitism=ELITISM, porcent_mute=MUTE)
